import React from 'react';

// COMPONENTS
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';

// IMAGES
import City1 from '../Images/City1.JPG'
import City2 from '../Images/City2.jpg'
import City3 from '../Images/City3.jpg'

// CSS
import '../css/Interests.css'

export default class Interests extends React.Component {
    state = {
        page: 0
    }


    render() {
        return (

            <div>

                {/* <h1>Interests</h1> */}

                {/* <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                    <li>Reading</li>
                </ul> */}

                <div className = 'Topic'>
                    <h1>Photography</h1>
                </div>

                <Parallax 
                    className = 'Parallax' 
                    ref={ref => (this.parallax = ref)} 
                    horizontal = {true}
                    pages={2} 
                    style = {{ 'height': '90vh' , 'padding': '10px' , 'width': '90%' }}>

                    <div className = 'Pictures'>

                        <ParallaxLayer
                            speed={1}
                            offset={0}
                            factor = {1}>

                            <div className = 'Container'>
                                <img src = {City1} className = 'Image'/> 
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer 
                            speed={2} 
                            offset={.5} 
                            factor = {1}>

                            <div className = 'Container'>
                                <img src = {City2} className = 'Image'/> 
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer 
                            speed={3} 
                            offset={1} 
                            factor = {1}>

                            <div className = 'Container'>
                                <img src = {City3} className = 'Image'/> 
                            </div>

                        </ParallaxLayer>

                    </div>

                </Parallax>

            </div>

        )
    }

}
